import{_ as a,c as l,o,a as t}from"./app.378791d3.js";const b='{"title":"Java","description":"","frontmatter":{},"headers":[],"relativePath":"web/java/index.md","lastUpdated":1656991224000}',e={},i=t('<h1 id="java" tabindex="-1">Java <a class="header-anchor" href="#java" aria-hidden="true">#</a></h1><p>\u2003\u2003Java \u662F Sun \u516C\u53F8\u63A8\u51FA\u7684\u80FD\u591F\u8DE8\u8D8A\u591A\u5E73\u53F0\u7684\u3001\u53EF\u79FB\u690D\u6027\u6700\u9AD8\u7684\u4E00\u79CD\u9762\u5411\u5BF9\u8C61\u7684\u7F16\u7A0B\u8BED\u8A00\uFF0C\u4E5F\u662F\u76EE\u524D\u6700\u5148\u8FDB\u3001\u7279\u5F81\u6700\u4E30\u5BCC\u3001\u529F\u80FD\u6700\u5F3A\u5927\u7684\u8BA1\u7B97\u673A\u8BED\u8A00\u3002\u5229\u7528 Java \u53EF\u4EE5\u7F16\u5199\u684C\u9762\u5E94\u7528\u7A0B\u5E8F\u3001Web \u5E94\u7528\u7A0B\u5E8F\u3001\u5206\u5E03\u5F0F\u7CFB\u7EDF\u5E94\u7528\u7A0B\u5E8F\u3001\u5D4C\u5165\u5F0F\u7CFB\u7EDF\u5E94\u7528\u7A0B\u5E8F\u7B49\uFF0C\u4ECE\u800C\u4F7F\u5176\u6210\u4E3A\u5E94\u7528\u6700\u5E7F\u6CDB\u7684\u5F00\u53D1\u8BED\u8A00\u3002</p><p>\u2003\u2003Java \u8BED\u8A00\u662F Sun \u516C\u53F8\u4E8E 1990 \u5E74\u5F00\u53D1\u7684\uFF1B1994 \u5E74\uFF0CGosling \u7528 Java \u8BED\u8A00\u5F00\u53D1\u4E86\u4E00\u4E2A\u5B9E\u7528\u6027\u8F83\u9AD8\u3001\u53EF\u9760\u3001\u5B89\u5168\u3001\u6709\u4EA4\u4E92\u529F\u80FD\u7684\u65B0\u578B Web \u6D4F\u89C8\u5668\uFF0C\u5B83\u4E0D\u4F9D\u8D56\u4E0E\u4EFB\u4F55\u786C\u4EF6\u5E73\u53F0\u548C\u8F6F\u4EF6\u5E73\u53F0\uFF0C\u8BE5\u6D4F\u89C8\u5668\u88AB\u547D\u540D\u4E3A HotJava\uFF0C\u5E76\u4E8E 1995 \u5E74\u5728\u4E1A\u754C\u53D1\u8868\uFF0C\u5F15\u8D77\u4E86\u5DE8\u5927\u7684\u8F70\u52A8\uFF0CJava \u8BED\u8A00\u7684\u5730\u4F4D\u968F\u4E4B\u5F97\u5230\u4E86\u80AF\u5B9A\uFF1B1995\u5E745\u670823\u65E5\uFF0CJDK\uFF08Java Developmenr Kit\uFF091.0a2 \u7248\u672C\u6B63\u662F\u5BF9\u5916\u53D1\u5E03\uFF1B2009\u5E744\u670820\u65E5\uFF0CSun \u516C\u53F8\u88AB Oracle \u516C\u53F8\u6536\u8D2D\u3002</p><p>\u4E3A\u4E86\u6EE1\u8DB3\u4E0D\u540C\u5F00\u53D1\u4EBA\u5458\u7684\u9700\u6C42\uFF0CJava \u5F00\u53D1\u5206\u6210\u4E86\u4EE5\u4E0B 3 \u4E2A\u65B9\u5411\uFF1A</p><ol><li><p>Java SE\uFF1A\u4E3B\u8981\u7528\u4E8E\u684C\u9762\u7A0B\u5E8F\u7684\u5F00\u53D1\u3002\u5B83\u662F\u5B66\u4E60 Java EE \u548C Java ME \u7684\u57FA\u7840\u3002</p></li><li><p>Java EE\uFF1A\u4E3B\u8981\u7528\u4E8E\u7F51\u9875\u7A0B\u5E8F\u7684\u5F00\u53D1\u3002\u968F\u7740\u4E92\u8054\u7F51\u7684\u53D1\u5C55\uFF0C\u8D8A\u6765\u8D8A\u591A\u7684\u4F01\u4E1A\u4F7F\u7528 Java \u8BED\u8A00\u6765\u5F00\u53D1\u81EA\u5DF1\u7684\u5B98\u65B9\u7F51\u7AD9\uFF0C\u5176\u4E2D\u4E0D\u4E4F\u4E00\u4E9B\u4E16\u754C 500 \u5F3A\u3002</p></li><li><p>Java ME\uFF1A\u4E3B\u8981\u7528\u4E8E\u5D4C\u5165\u5F0F\u7CFB\u7EDF\u7A0B\u5E8F\u7684\u5F00\u53D1\u3002</p></li></ol><h1 id="java-\u8BED\u8A00\u7684\u7279\u70B9" tabindex="-1">Java \u8BED\u8A00\u7684\u7279\u70B9 <a class="header-anchor" href="#java-\u8BED\u8A00\u7684\u7279\u70B9" aria-hidden="true">#</a></h1><ol><li>\u7B80\u5355</li></ol><blockquote><p>Java \u8BED\u8A00\u7684\u8BED\u6CD5\u7B80\u5355\u660E\u4E86\uFF0C\u5BB9\u6613\u638C\u63E1\uFF0C\u800C\u4E14\u662F\u7EAF\u9762\u5BF9\u5BF9\u8C61\u7684\u8BED\u8A00\u3002</p></blockquote><p>Java \u8BED\u8A00\u7684 \u7B80\u5355\u6027\u4E3B\u8981\u4F53\u73B0\u5728\u4EE5\u4E0B\u51E0\u70B9\uFF1A</p><ul><li>\u8BED\u6CD5\u89C4\u5219\u548C C++\u7C7B\u4F3C\u3002\u4ECE\u67D0\u79CD\u610F\u4E49\u4E0A\u8BB2\uFF0CJava \u8BED\u8A00\u662F\u7531 C \u548C C++\u8BED\u8A00\u8F6C\u53D8\u800C\u6765\uFF0C\u6240\u4EE5 C \u7A0B\u5E8F\u8BBE\u8BA1\u4EBA\u5458\u53EF\u4EE5\u5F88\u5BB9\u6613\u5730\u638C\u63E1 Java \u8BED\u8A00\u7684\u8BED\u6CD5\u3002</li><li>Java \u8BED\u8A00\u53EF\u4EE5\u5BF9 C++\u8FDB\u884C\u4E86\u7B80\u5316\u548C\u63D0\u9AD8\u3002</li><li>Java \u63D0\u4F9B\u4E86\u4E30\u5BCC\u7684\u7C7B\u5E93\u548C API \u6587\u6863\u4EE5\u53CA\u7B2C\u4E09\u65B9\u5F00\u53D1\u5305\uFF0C\u53E6\u5916\u8FD8\u6709\u5927\u91CF\u7684\u57FA\u4E8E Java \u7684\u5F00\u6E90\u9879\u76EE\uFF0C\u73B0\u5728 JDK \u4E5F\u5F00\u653E\u6E90\u4EE3\u7801\u4E86\uFF0C\u8BFB\u8005\u53EF\u4EE5\u901A\u8FC7\u5206\u6790\u9879\u76EE\u7684\u6E90\u4EE3\u7801\uFF0C\u63D0\u9AD8\u81EA\u5DF1\u7684\u7F16\u7A0B\u6C34\u5E73\u3002</li></ul><ol start="2"><li>\u9762\u5411\u5BF9\u8C61</li></ol><blockquote><p>Java \u8BED\u8A00\u672C\u8EAB\u662F\u4E00\u79CD\u9762\u5411\u5BF9\u8C61\u7684\u7A0B\u5E8F\u8BBE\u8BA1\u8BED\u8A00\u3002Java \u63D0\u5021\u4E07\u7269\u7686\u5BF9\u8C61\uFF0C\u8BED\u6CD5\u4E2D\u4E0D\u80FD\u5728\u7C7B\u5916\u9762\u5B9A\u4E49\u5355\u72EC\u7684\u53D8\u91CF\u548C\u65B9\u6CD5\uFF0C\u4E5F\u5C31\u662F\u8BF4\uFF0CJava \u8BED\u8A00\u6700\u5916\u90E8\u7684\u6570\u636E\u7C7B\u578B\u662F\u5BF9\u8C61\uFF0C\u6240\u6709\u7684\u5143\u7D20\u90FD\u8981\u901A\u8FC7\u7C7B\u548C\u5BF9\u8C61\u6765\u8BBF\u95EE\u3002</p></blockquote><ol start="3"><li>\u5206\u5E03\u6027</li></ol><blockquote><p>Java \u7684\u5206\u5E03\u6027\u5305\u62EC\u64CD\u4F5C\u5206\u5E03\u548C\u6570\u636E\u5206\u5E03\uFF0C\u5176\u4E2D\u64CD\u4F5C\u5206\u5E03\u662F\u6307\u5728\u591A\u4E2A\u4E0D\u540C\u7684\u4E3B\u673A\u4E0A\u5E03\u7F6E\u76F8\u5173\u64CD\u4F5C\u3002\u800C\u6570\u636E\u5206\u5E03\u662F\u5C06\u6570\u636E\u5206\u522B\u5B58\u653E\u5728\u591A\u4E2A\u4E0D\u540C\u7684\u4E3B\u673A\u4E0A\uFF0C\u8FD9\u4E9B\u4E3B\u673A\u662F\u7F51\u7EDC\u4E2D\u7684\u4E0D\u540C\u6210\u5458\u3002Java \u53EF\u4EE5\u51ED\u501F URL \u5BF9\u8C61\u8BBF\u95EE\u7F51\u7EDC\u5BF9\u8C61\uFF0C\u8BBF\u95EE\u65B9\u5F0F\u4E0E\u8BBF\u95EE\u672C\u5730\u7CFB\u7EDF\u76F8\u540C\u3002</p></blockquote><ol start="4"><li>\u53EF\u79FB\u690D\u6027</li></ol><blockquote><p>Java \u7A0B\u5E8F\u5177\u6709\u4E0E\u4F53\u7CFB\u7ED3\u6784\u65E0\u5173\u7684\u7279\u6027\uFF0C\u4ECE\u800C\u4F7F Java \u7A0B\u5E8F\u53EF\u4EE5\u65B9\u4FBF\u5730\u79FB\u690D\u5230\u7F51\u7EDC\u7684\u4E0D\u540C\u8BA1\u7B97\u673A\u4E2D\u3002\u540C\u65F6\uFF0CJava \u7684\u7C7B\u5E93\u4E2D\u4E5F\u5B9E\u73B0\u4E86\u9488\u5BF9\u4E0D\u540C\u5E73\u53F0\u7684\u63A5\u53E3\uFF0C\u4F7F\u8FD9\u4E9B\u7C7B\u5E93\u4E5F\u53EF\u4EE5\u79FB\u690D\u3002</p></blockquote><ol start="5"><li>\u89E3\u91CA\u6027</li></ol><blockquote><p>\u8FD0\u884C Java \u7A0B\u5E8F\u9700\u8981\u89E3\u91CA\u5668\u3002\u4EFB\u4F55\u79FB\u690D\u4E86 Java \u89E3\u91CA\u5668\u7684\u8BA1\u7B97\u673A\u6216\u5176\u4ED6\u8BBE\u5907\u90FD\u53EF\u4EE5\u7528 Java \u5B57\u8282\u7801\u8FDB\u884C\u89E3\u91CA\u6267\u884C\u3002\u5B57\u8282\u7801\u72EC\u7ACB\u4E8E\u5E73\u53F0\uFF0C\u5B83\u672C\u8EAB\u643A\u5E26\u4E86\u8BB8\u591A\u7F16\u8BD1\u65F6\u4FE1\u606F\uFF0C\u4F7F\u5F97\u8FDE\u63A5\u8FC7\u7A0B\u66F4\u52A0\u7B80\u5355\uFF0C\u5F00\u53D1\u8FC7\u7A0B\u4E5F\u5C31\u66F4\u52A0\u8FC5\u901F\uFF0C\u66F4\u5177\u63A2\u7D22\u6027\u3002</p></blockquote><ol start="6"><li>\u5B89\u5168\u6027</li></ol><blockquote><p>Java \u8BED\u8A00\u5220\u9664\u4E86\u7C7B\u4F3C C \u8BED\u8A00\u4E2D\u7684\u6307\u9488\u548C\u5185\u5B58\u91CA\u653E\u7B49\u8BED\u6CD5\uFF0C\u4ECE\u800C\u6709\u6548\u5730\u907F\u514D\u4E86\u975E\u6CD5\u64CD\u4F5C\u5185\u5B58\u3002Java \u7A0B\u5E8F\u4EE3\u7801\u8981\u7ECF\u8FC7\u4EE3\u7801\u6821\u9A8C\u3001\u6307\u9488\u6821\u9A8C\u7B49\u5F88\u591A\u7684\u6D4B\u8BD5\u6B65\u9AA4\u624D\u80FD\u591F\u8FD0\u884C\uFF0C\u6240\u4EE5\u672A\u7ECF\u5141\u8BB8\u7684 Java \u7A0B\u5E8F\u4E0D\u53EF\u80FD\u51FA\u73B0\u635F\u5BB3\u7CFB\u7EDF\u5E73\u53F0\u7684\u884C\u4E3A\uFF0C\u800C\u4E14\u4F7F\u7528 Java \u53EF\u4EE5\u7F16\u5199\u9632\u75C5\u6BD2\u548C\u9632\u4FEE\u6539\u7684\u7CFB\u7EDF\u3002</p></blockquote><ol start="7"><li>\u5065\u58EE\u6027</li></ol><blockquote><p>Java \u7684\u8BBE\u8BA1\u76EE\u6807\u4E4B\u4E00\u662F\u7F16\u5199\u591A\u65B9\u9762\u53EF\u9760\u7684\u5E94\u7528\u7A0B\u5E8F\uFF0CJava \u5C06\u68C0\u67E5\u7A0B\u5E8F\u5728\u7F16\u8BD1\u548C\u8FD0\u884C\u65F6\u7684\u9519\u8BEF\uFF0C\u4EE5\u53CA\u6D88\u9664\u9519\u8BEF\u3002\u7C7B\u578B\u68C0\u67E5\u80FD\u5E2E\u52A9\u7528\u6237\u68C0\u67E5\u51FA\u8BB8\u591A\u5F00\u53D1\u65E9\u671F\u8BD1\u51FA\u73B0\u7684\u9519\u8BEF\u3002\u540C\u65F6\uFF0C\u5F88\u591A\u96C6\u6210\u5F00\u53D1\u5DE5\u5177 IDE\uFF08\u5982 Eclipse\u3001NetBeans\uFF09\u7684\u51FA\u73B0\u4F7F\u7F16\u8BD1\u548C\u8FD0\u884C Java \u7A0B\u5E8F\u66F4\u52A0\u5BB9\u6613\u3002</p></blockquote><ol start="8"><li>\u591A\u7EBF\u7A0B</li></ol><blockquote><p>\u591A\u7EBF\u7A0B\u673A\u5236\u80FD\u591F\u4F7F\u5E94\u7528\u7A0B\u5E8F\u5728\u540C\u4E00\u65F6\u95F4\u5E76\u884C\u6267\u884C\u591A\u9879\u4EFB\u52A1\uFF0C\u800C\u4E14\u76F8\u5E94\u7684\u540C\u6B65\u673A\u5236\u53EF\u4EE5\u4FDD\u8BC1\u4E0D\u540C\u7EBF\u7A0B\u80FD\u591F\u6B63\u786E\u5730\u5171\u4EAB\u6570\u636E\u3002\u4F7F\u7528\u591A\u7EBF\u7A0B\uFF0C\u53EF\u4EE5\u5E26\u6765\u66F4\u597D\u7684\u4EA4\u4E92\u80FD\u529B\u548C\u5B9E\u65F6\u884C\u4E3A\u3002</p></blockquote><ol start="9"><li>\u9AD8\u6027\u80FD</li></ol><blockquote><p>Java \u7F16\u8BD1\u540E\u7684\u5B57\u8282\u7801\u662F\u5728\u89E3\u91CA\u5668\u4E2D\u8FD0\u884C\u7684\uFF0C\u6240\u4EE5\u5B83\u7684\u901F\u5EA6\u6BD4\u591A\u6570\u4EA4\u4E92\u5E94\u7528\u7A0B\u5E8F\u63D0\u9AD8\u4E86\u5F88\u591A\u3002\u53E6\u5916\uFF0C\u5B57\u8282\u7801\u53EF\u4EE5\u5728\u7A0B\u5E8F\u8FD0\u884C\u65F6\u88AB\u7FFB\u8BD1\u6210\u7279\u5B9A\u5E73\u53F0\u7684\u673A\u5668\u6307\u4EE4\uFF0C\u4ECE\u800C\u8FDB\u4E00\u6B65\u63D0\u9AD8\u8FD0\u884C\u901F\u5EA6\u3002</p></blockquote><ol start="10"><li>\u52A8\u6001</li></ol><blockquote><p>Java \u5728\u5F88\u591A\u65B9\u4FBF\u6BD4 C \u548C C++\u66F4\u80FD\u591F\u9002\u5E94\u53D1\u5C55\u7684\u73AF\u5883\uFF0C\u53EF\u4EE5\u52A8\u6001\u8C03\u6574\u5E93\u4E2D\u65B9\u6CD5\u548C\u53D8\u91CF\u7684\u589E\u52A0\uFF0C\u800C\u5BA2\u6237\u7AEF\u5374\u4E0D\u9700\u8981\u4F5C\u4EFB\u4F55\u66F4\u6539\u3002\u5728 Java \u4E2D\u52A8\u6001\u8C03\u6574\u662F\u975E\u5E38\u7B80\u5355\u3001\u76F4\u63A5\u7684\u3002</p></blockquote>',28),v=[i];function p(J,c,r,s,u,n){return o(),l("div",null,v)}var d=a(e,[["render",p]]);export{b as __pageData,d as default};
